/**
 * An enumeration of prayer icons above the head.
 */
declare enum HeadIcon {
	/**
	 * Protect from melee.
	 */
	MELEE,
	/**
	 * Protect from ranged.
	 */
	RANGED,
	/**
	 * Protect from magic.
	 */
	MAGIC,
	/**
	 * Retribution prayer.
	 */
	RETRIBUTION,
	/**
	 * Smite prayer.
	 */
	SMITE,
	/**
	 * Redemption prayer.
	 */
	REDEMPTION,
	/**
	 * Protect from range and mage. (ie. used by Kalphite Queen)
	 */
	RANGE_MAGE,
	/**
	 * Protect from range and melee.
	 */
	RANGE_MELEE,
	/**
	 * Protect from mage and melee.
	 */
	MAGE_MELEE,
	/**
	 * Protect from range, mage, and melee.
	 */
	RANGE_MAGE_MELEE,
	/**
	 * Wrath curse.
	 */
	WRATH,
	/**
	 * Soult split curse.
	 */
	SOUL_SPLIT,
	/**
	 * Deflect melee curse.
	 */
	DEFLECT_MELEE,
	/**
	 * Deflect range curse.
	 */
	DEFLECT_RANGE,
	/**
	 * Deflect magic curse.
	 */
	DEFLECT_MAGE,
}
